import Comment from './Comments/Comment';

function Post() {
  return (
    <>
    {/* post section  */}
	<div id="post id">

        <h2 className="title"><a href="" rel="bookmark" title="Permanent Link to ">The Title</a></h2>

        <div className="entry">
            Content
        </div>

        <p className="postmetadata">
            Posted in time &nbsp; tags
        </p>
    </div>
    {/*  end post section */}
    <Comment />
    </>
  )
}

export default Post
